import React, { Component } from "react";

// import { Link } from "react-router-dom";

class Landing extends Component {
  render() {
    return (
      <div  className="container-fluid"  id="landing">


      <h3>Les enfants en tutelle</h3>
          <div className ="row">
			       <div className="col-md-6">
			            <img id="image" src="https://p1.storage.canalblog.com/17/01/421949/106978478_o.jpg"/>
			       </div>

			       <div className="col-md-6">
			           <h5>Les enfants en tutelle</h5>

                 <p>
                  Pendre en charge des enfants que les familles malgaches nous confient sous 
                  l’autorité du Tribunal d’Instance d’Antananarivo est la fonction de base
                   de l’ONG Zazakely – Enfants de Madagascar depuis sa création.
                 </p>
			       </div>
          </div>

      </div>
    );
  }
}

export default Landing;
